import axios from 'axios'

const list = () => axios.get(`http://localhost:8080/works/list`)
const register = (payload) => {
  alert(`register axios`)
  return axios.post(`http://localhost:8080/works/register`, payload)
}
const read = (payload) => axios.get(`http://localhost:8080/works/read`)
const modify= (payload) => axios.put(`http://localhost:8080/works/modify`, payload)
const del = () => axios.delete(`http://localhost:8080/works/delete`)

export default { list, register, read, modify, del }
